$(function () {
    "use strict";
    var t = $("#dashbord_tour");
    t.length &&
        t.on("click", function () {
            var t,
                e,
                a,
                ac,
                as,
                addlead,
                finish,
                n = new Shepherd.Tour({ defaultStepOptions: { classes: "shadow-md", scrollTo: !1, cancelIcon: { enabled: !0 } }, useModalOverlay: !0 });
                (e = "btn btn-sm btn-outline-secondary"),
                (finish = "btn btn-sm btn-outline-secondary finish-tour"),
                (ac = "btn btn-sm btn-secondary btn-next close-modal"),
                (as = "btn btn-sm btn-secondary btn-next go-to-setting-tour"),
                (a = "btn btn-sm btn-secondary btn-next"),
                (addlead = "btn btn-sm btn-secondary btn-next add-lead-tour"),
                (t = n).addStep({
                    title: "Add Lead",
                    text: "You can add lead by clicking this plus(+) button",
                    attachTo: { element: ".add-float", on: "left" },
                    buttons: [
                        { text: "Finish", classes: finish, action: t.cancel },
                        { text: "Next", classes: addlead, action: t.next },
                    ],
                }),
                t.addStep({
                    title: "Lead Details",
                    text: "Here you can add your Lead Details.",
                    attachTo: { element: ".add-lead-modal", on: "center" },
                    buttons: [
                        { text: "Back", classes: e, action: t.back },
                        { text: "Next", classes: a, action: t.next },
                    ],
                }),
                t.addStep({
                    title: "Add / Change Steps",
                    text: "These Steps are filters which Shows Status of Your Leads. Your can rename this status as per your requirement or add/delete status from steps in settings.",
                    attachTo: { element: ".add-form-change-lead-steps", on: "top" },
                    buttons: [
                        { text: "Back", classes: e, action: t.back },
                        { text: "Next", classes: ac, action: t.next },
                    ],
                }),
                t.addStep({
                    title: "Go to setting",
                    text: "Setting Section is Where you can add custom.",
                    attachTo: { element: ".setting-side-menu", on: "right" },
                    buttons: [
                        { text: "Back", classes: e, action: t.back },
                        { text: "Next", classes: as, action: t.next },
                    ],
                }),   
                t.start();
        });
});



$(function () {
    "use strict";
    var t = $("#setting_tour");
    t.length &&
        t.on("click", function () {
            var t,
                e,
                sst,
                gtr,
                finish,
                a,
                n = new Shepherd.Tour({ defaultStepOptions: { classes: "shadow-md", scrollTo: !1, cancelIcon: { enabled: !0 } }, useModalOverlay: !0 });
                (e = "btn btn-sm btn-outline-secondary"),
                (a = "btn btn-sm btn-secondary btn-next"),
                (sst = "btn btn-sm btn-secondary btn-next step-setting-tab"),
                (gtr = "btn btn-sm btn-secondary btn-next go-to-report"),
                (finish = "btn btn-sm btn-outline-secondary finish-tour"),
                (t = n).addStep({
                    title: "Manage the Lead Status Steps",
                    text: "By Clicking here you will go Steps setting tab.",
                    attachTo: { element: ".step-change-side-menu", on: "right" },
                    buttons: [
                        { action: t.cancel, classes: finish, text: "Finish Tour" },
                        { text: "Next", classes: sst, action: t.next },
                    ],
                }),
                t.addStep({
                    title: "Manage Steps",
                    text: "Here you can add, remove or edit your steps",
                    attachTo: { element: ".add-steps-pannel", on: "center" },
                    buttons: [
                        { text: "Back", classes: e, action: t.back },
                        { text: "Next", classes: a, action: t.next },
                    ],
                }),
                t.addStep({
                    title: "Lead Reports",
                    text: "By clicking here you will know about reports.",
                    attachTo: { element: ".report-side-menu", on: "right" },
                    buttons: [
                        { text: "Back", classes: e, action: t.back },
                        { text: "Next", classes: gtr, action: t.cancel },
                    ],
                }),
                t.start();
        });
});



$(function () {
    "use strict";
    var t = $("#report_tour");
    t.length &&
        t.on("click", function () {
            var t,
                e,
                a,
                finish,
                endTour,
                n = new Shepherd.Tour({ defaultStepOptions: { classes: "shadow-md", scrollTo: !1, cancelIcon: { enabled: !0 } }, useModalOverlay: !0 });
                (e = "btn btn-sm btn-outline-secondary"),
                (a = "btn btn-sm btn-secondary btn-next"),
                (finish = "btn btn-sm btn-outline-secondary finish-tour"),
                (endTour = "btn btn-sm btn-secondary finish-tour"),
                (t = n).addStep({
                    title: "Report Section",
                    text: "This is the lead report section.",
                    attachTo: { element: ".lead-report-table-div", on: "right" },
                    buttons: [
                        { action: t.cancel, classes: finish, text: "Finish Tour" },
                        { text: "Next", classes: a, action: t.next },
                    ],
                }),
                t.addStep({
                    title: "Won Leads",
                    text: "All the Won(Converted) leads are Shown Here.",
                    attachTo: { element: ".won-tab", on: "left" },
                    buttons: [
                        { text: "Back", classes: e, action: t.back },
                        { text: "Next", classes: a, action: t.next },
                    ],
                }),
                t.addStep({
                    title: "Lost Leads",
                    text: "All the Lost leads are Shown Here.",
                    attachTo: { element: ".lost-tab", on: "left" },
                    buttons: [
                        { text: "Back", classes: e, action: t.back },
                        { text: "Finish", classes: endTour, action: t.cancel },
                    ],
                }),
                t.start();
        });
});